import Typography from '@material-ui/core/Typography';
import style from '../Component/css/Error.module.scss'


import Link from 'next/link';

function Error(props) {

  
    return (
        <>
         <NextSeo
                    title={post.title}
                    description={post.excerpt}
                    noindex={ true}
                    nofollow={true}
                /> 
        <div className={style.customError}>
        <Typography className={style.heading} component="h1" variant="h1"> 404 Some Thing Worng </Typography> 
        <p className={style.paragraf}> {JSON.parse(props.concerter).message}</p>
        <Link href="/"> 
            <a className={style.customeHome}> Home</a>
        </Link>
      </div>
      </>
    )
  }

  export default Error
